import React from 'react';
import './Button.css';

const UIButton = ({ children, className, component: Component }) => {
  return (
    <Component className={`ui-button ${className}`}>{children}</Component>
  )

  UIButton.defaultProps = {
    component: 'button',
    className: '',
  }
}

export default UIButton;
